// Grab all items from the "Get Boulevard Problems" node
const items = $items("Get Braeton problems", 0, 0);

// Flatten out all "result" arrays and pull the trigger IDs
const triggerids = items
  .flatMap(i => i.json.result || [])
  .map(p => p.objectid)
  .filter(id => id); // remove null/undefined

return [{ json: { triggerids } }];

